SET DEFINE OFF
SET FEEDBACK OFF
SET ECHO OFF
set sqlterminator ';'

drop table "Comment" cascade constraints;

drop table "favourites" cascade constraints;

drop table "Media" cascade constraints;

drop table "Film" cascade constraints;

drop table BOOK cascade constraints;

drop table "Creator" cascade constraints;

drop table "member_of" cascade constraints;

drop table "Reply" cascade constraints;

drop table "Discussion" cascade constraints;

drop table USERS cascade constraints;

drop table "Postal_Code" cascade constraints;

drop table "Club" cascade constraints;


create table "Postal_Code" (
    "postal_code" VARCHAR2(6)   not null
        primary key,
    "city"        VARCHAR2(255) not null,
    "province"    VARCHAR2(255) not null
);

CREATE TABLE USERS (
	"email" varchar(255) NOT NULL PRIMARY KEY,
	"fName" varchar(255),
	"dateCreated" TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	"salt" varchar(32) NOT NULL,
	"hashed_password" varchar(64) NOT NULL,
    "postal_code" VARCHAR2(255) constraint "postal_code_fk" references "Postal_Code" on delete set null
);

create table "Film"
(
    "id"       NUMBER generated by default on null as identity primary key,
    "title"    VARCHAR2(255) not null,
    "date"     NUMBER,
    "rating"   FLOAT,
    "genres"   VARCHAR2(255),
    "duration" NUMBER
);

create table "Creator"
(
    "id"        NUMBER generated by default on null as identity
        primary key,
    "name"      VARCHAR2(255),
    "birthdate" DATE,
    TYPE        NUMBER
);

create table BOOK
(
    "id"        NUMBER generated by default on null as identity
        primary key,
    "title"     VARCHAR2(255) not null,
    "date"      VARCHAR2(255),
    "rating"    FLOAT,
    "subject"   VARCHAR2(255),
    AUTHOR      NUMBER
        constraint BOOK_AUTHOR_FK0
            references "Creator",
    DESCRIPTION CLOB
);

create table "Media"
(
    "id"       NUMBER generated by default on null as identity primary key,
    "book_id"  NUMBER
        constraint "Media_fk_book"
            references Book
                on delete cascade,
    "film_id"  NUMBER
        constraint "Media_fk_film"
            references "Film"
                on delete cascade,
    constraint "Media_key_unique"
        check (("book_id" is NOT NULL and "film_id" is NULL)
            or ("book_id" is NULL and "film_id" is NOT NULL))
);

create table "Comment"
(
    "id"        NUMBER generated by default on null as identity
        primary key,
    "date"      TIMESTAMP(6) default SYSDATE,
    "rating"    NUMBER,
    "author_id" VARCHAR2(255)
        constraint "Comment_author_fk"
            references Users
                on delete cascade,
    "media_id"  NUMBER
        constraint "Comment_media_fk"
            references "Media"
                on delete cascade,
    BODY clob not null
);

create table "favourites"
(
    "user_id"  VARCHAR2(255)
        constraint "favourites_user_fk"
            references Users
                on delete cascade,
    "media_id" NUMBER
        constraint "favourites_media_fk"
            references "Media"
                on delete cascade
);

create table "Club"
(
    "id"               NUMBER generated by default on null as identity
        primary key,
    "date"             TIMESTAMP(6) default SYSDATE,
    "name"             VARCHAR2(255) not null
        unique,
    "description"      VARCHAR2(255),
    COMMENT_COUNT    NUMBER       default 0,
    DISCUSSION_COUNT NUMBER       default 0,
    MEMBER_COUNT     NUMBER       default 1
);

create table "member_of"
(
    "user_id" VARCHAR2(255)
        constraint "member_of_user_fk"
            references Users
                on delete cascade,
    "club_id" NUMBER
        constraint "member_of_club_fk"
            references "Club"
                on delete cascade,
    "role"    NUMBER
);

create table "Discussion"
(
    "id"        NUMBER generated by default on null as identity
        primary key,
    "date"      TIMESTAMP(6) default SYSDATE,
    "club_id"   NUMBER
        constraint "Discussion_club_fk"
            references "Club"
                on delete cascade,
    "author_id" VARCHAR2(255)
        constraint "Discussion_author_fk"
            references Users
                on delete cascade,
    "content"   VARCHAR2(255) not null
);

create table "Reply"
(
    "id"            NUMBER generated by default on null as identity
        primary key,
    "date"          TIMESTAMP(6) default SYSDATE,
    "discussion_id" NUMBER
        constraint "Reply_discussion_fk"
            references "Discussion"
                on delete cascade,
    "author_id"     VARCHAR2(255)
        constraint "Reply_author_fk"
            references Users
                on delete cascade,
    "content"       VARCHAR2(255) not null
);

